import { useState } from 'react';
import styles from './Delete.module.css';

function Delete (props){

    const [no , setNo] = useState(styles.del);
    console.log(props.onDel);
    console.log(!props.onDel);

    const noBtnHandler = () => {
        setNo(!props.onDestyles.delOn);
    }

    return(
    <div className = {no}>
            <section>
                <div>
                    <h3>Are you Sure ?</h3>
                </div>
                <div>
                    <button type = 'button'> Yes </button>
                    <button type = 'button' onClick = {noBtnHandler}> No </button>
                </div>
            </section>
        </div>
   );
}

export default Delete;
